import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

import {
  TodoForm,
  TodoList,
  Home,
  TodoItem,
  EditTodo,
} from './pages';
import { BASE_URL } from './utils/constants';

import './App.scss';

export default function App() {
  return (
    <div className="app">
      {/* <Home /> */}
      <Router basename={BASE_URL}>
          <Route component={Home} exact path="/" />
          <Route component={TodoForm} path="/create" />
          <Route component={TodoList} path="/all" />
          <Route component={TodoItem} path="/view/:id" />
          <Route component={EditTodo} path="/edit/:id" />
      </Router>
    </div>
  );
}
